import React from "react";

const NavButtons = ({ goToPrevPage, goToNextPage }) => {
    return (
        <div>
            {goToPrevPage && <button id="back" type="button" onClick={goToPrevPage}>BACK</button>}
            {goToNextPage && <button id="nextBtn" type="button" onClick={goToNextPage}>NEXT</button>}
        </div>
    );
}

export default NavButtons;
